var tipuesearch = {"pages":[{"text":"2016Fall 修課成員網誌","tags":"misc","title":"About","url":"./pages/about/"},{"text":"開啟SciTE編輯start.bat找到python.exe開啟之後再讀取launchLeo.py然後在哪裡 自行開啟Leo from 陳士正 on Vimeo .","tags":"Misc","title":"用start開啟Leo","url":"./yong-startkai-qi-leo.html"},{"text":"在Virtualbox中,以橋接網路卡設定,建立一台 Ubuntu伺服主機 sudo apt update幫我們把下載的網站資料update到最新,如果不行就用 sudo rm /var/lib/dpkg/lock 把lock刪除掉 , sudo apt install nginx 安裝nginx ,用ifconfig再到外部的瀏覽器打上IP:80就可以看到,如果像要知道檔案在哪裡就 cd /var/www/html , ls -l ,sudo vi index.nginx-debian.html 就可更改 上課內容練習 from 陳士正 on Vimeo .","tags":"Misc","title":"2017-04-21上課內容練習","url":"./2017-04-21shang-ke-nei-rong-lian-xi.html"}]};